import React from "react";
import { FormGroup, Label, Input, Form } from "reactstrap";

const NewNoteForm = () => {
  return (
    <Form>
      <FormGroup>
        <Label>Which project is this for?</Label>
        <Input type="text" placeholder="Enter Project Name" />
      </FormGroup>
      <FormGroup check>
          <Label>What type of a note is this?</Label>
        <Label check>
          <Input type="radio" name="noteTypeRadio" />
          Text
        </Label>
      </FormGroup>
      <FormGroup check>
        <Label check>
          <Input type="radio" name="noteTypeRadio" />
          Link
        </Label>
      </FormGroup>
    </Form>
  );
};

export default NewNoteForm;
